#!/usr/bin/env python3

# Standard library imports
from random import randint, choice as rc
import random

# Remote library imports
from faker import Faker

# Local imports
from app import app
from models import db, User, Post, Plant, Forum

if __name__ == '__main__':
    fake = Faker()
    with app.app_context():
        print("Starting seed...")
        
        User.query.delete()
        Post.query.delete()
        Plant.query.delete()
        Forum.query.delete()

        # Sample Data:
        accountTypes = ["Guide", "Planter"]
        genres = ["Question", "Post", "Answer"]
        common_names = ["Cactus", "Bonsai Tree", "Rose", "Olive Tree"]
        scientific_names = ["Cactaceae", "Ulmus Parvifolia", "Rosa Rubiginosa", "Olea Europaea"]
        plant_imgs = ["https://www.bhg.com/thmb/JYtmk5gTi4JvaUcysiN4ZsHXt80=/3600x0/filters:no_upscale():strip_icc()/Potted-cactus-EiHKvUBNqIBANnCjl7r2D4-74ca80d73efc4325ab4802a6a4ea379b.jpg", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQGuwkVuhMqY7Xp-_uPRAAEPSR49ecBrkfmNg&usqp=CAU", "data:image/jpeg;base64,"], 
        growing_levels = ["Beginner", "Intermediate", "Advanced"]
        titles = ["Growing Help", "Plant Memes", "Species Research"]

        users = []
        for i in range(25):
            user = User(
                username=fake.user_name(),
                accountType=random.rc(accountTypes)
            )
            users.append(user)
        
        db.session.add_all(users)

        posts = []
        for i in range(50):
            post = Post(
                content=fake.sentence(nb_words=5),
                genre=random.rc(genres),
                user_id=random.randint(1, 25),
                forum_id=random.randint(1, 25)
            )
            posts.append(post)

        db.session.add_all(posts)

        plants = []
        for i in range(25):
            plant = Plant(
                common_name=random.rc(common_names),
                scientific_name=random.rc(scientific_names),
                img=random.rc(plant_imgs),
                growing_level=random.rc(growing_levels)
            )
            plants.append(plant)

        db.session.add_all(plants)

        forums = []
        for i in range(25):
            forum = Forum(
                title=random.rc(titles),
                followers=random.randint(1, 500)
            )
            forums.append(forum)

        db.session.add_all(forums)
        db.session.commit()



